import React from "react";

function Form(props){
    return (
      <form className="form">
        <input
            type="text"
            placeholder="Username"
        />
        <input 
            type="password"
            placeholder="Passsword"
        /> 
        <input type="password" placeholder="Confirm Password"/>
  
        <button type="submit">{props.isRegistered} :</button>
    </form>
    )
}

export default Form;
